import React from "react";
import Nav from "./Nav";
import Main from "./Main";
import Footer from "./Footer";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

const Home = ({ cards }) => {
  return (
    <>
      <Routes>
        <Nav />
        <Main cards={cards} />
        <Footer />
      </Routes>
    </>
  );
};

export default Home;
